import React from "react";

const Landing = () => {
  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Hello HI HOW ARE YOU , Welcome to API Assignment</h1>
    </div>
  );
};

const styles = {
  container: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "100vh",
    backgroundColor: "#f0f4f8",
  },
  heading: {
    fontSize: "2rem",
    color: "#333",
    fontFamily: "'Roboto', sans-serif",
    textAlign: "center",
  },
};

export default Landing;
